width\":275,\"height\":183},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"subContentId\":\"a070669e-5986-4f9e-ae28-f7f42f44558b\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":42.319749216301,\"y\":12.374241486068,\"width\":54.545454545455,\"height\":24.148606811146,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3>Family groups sometimes get together to form herds for survival purposes.</h3>\\n\\n<p>Â </p>\\n\"},\"subContentId\":\"799e9767-9ec9-4c37-8592-1c22b2332c66\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":42.319749216301,\"y\":37.137151702786,\"width\":56.112852664577,\"height\":61.300309597523,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3>One zebra eating on its own has a 100% chance of being caught by a predator. If there are two zebras, however, they each have a 50% chance of being caught. In a herd of 100 zebras, each zebra has a 1% chance of being attacked by a predator.Â </h3>\\n\"},\"subContentId\":\"6f9b02f1-672b-4c89-a3c5-a69cb1f9e1f2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{\"fillSlideBackground\":\"#e8e6e7\"}},{\"elements\":[{\"x\":0,\"y\":43.343653250774,\"width\":98.119122257053,\"height\":55.108359133127,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3>Known predators of zebras include lions, leopards, cheetahs and hyenas. When danger approaches, the stallion will alert the others with a high-pitched snort.</h3>\\n\\n<h3>He will stand his ground while the rest of the family runs away in zigzag fashion. If he must fight, he will lower his head with neck outstretched and teeth bared, prepared to bite. However, running away is the usual tactic, sometimes accompanied by a defensive kick. The kick can be powerful, though, and can cause serious injury to a predator.</h3>\\n\"},\"subContentId\":\"4495f5a2-ac33-40a1-8947-61a6396bb249\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":25.078369905956,\"y\":3.0959752321981,\"width\":36.160872489531,\"height\":40,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wCEAAkGBxITEhUSEhISEBIQEA8VDxUVFRAPEBAPFREWFhUVFRUYHSggGBolGxYVITEhJSkrLi46Fx8zODMtNygtLisBCgoKDg0OFxAQGi0fHR0tLS0tLS0tLS0tLS0tLS0tLS0tLS0tLS0tLS0tLS0tLS0tKy0tLS0tLS0tLS0tLS0tLf/AABEIAKgBLAMBIgACEQEDEQH/xAAbAAACAwEBAQAAAAAAAAAAAAACAwABBAUGB//EAD0QAAICAQMDAgQCCAQGAgMAAAECABEDBBIhMUFRBRMiYXGBMpEGFCNCUmKhsXLB8PFTgpKi0eEVJDNDY//EABkBAQEBAQEBAAAAAAAAAAAAAAEAAgMEBf/EACMRAQEBAQACAwABBQEAAAAAAAABEQIDIRIxQRMiMlFhcQT/2gAMAwEAAhEDEQA/AOvkxntBOnJHM0+5D3AjpPlO+Odk0lC7gabTnqZ0GxgwVx1xNSr4szOPnNGPIviEmAQ1WjzLWpyCxD2XCcDxH6dflA4BfhHSJOSbdQDXSpzsieISqwRyS0NwMI8xw8iIxbKai8aE9ZqU31hY0tlXoGZR9ATJYyLpyI3HinE/Sv1VtLqRiVXy18RAeg+IAdBt4N2Os7qrcLLmq840gV0lbL7ysYMOpnQB8Qi1WuhBkfJzIhFx1KKmIykzaTE7ZaSEYynaaTimfIvMYigwhgwGWWLEVoy0LfE5OZaDjmR0YySi8Tt5ljiS00GUGi2yeZW+SaC3zhAzMDGq0AM
